import "./App.css";
import Navbar from "./components/Header/Header";
import Availablecakes from "./components/Meals/Availablecakes";

import "bootstrap/dist/css/bootstrap.min.css";
import CartProvider from "./components/store/CartProvider";

function App() {
  return (
    <CartProvider>
      <Navbar />
      <Availablecakes />
    </CartProvider>
  );
}

export default App;
